(22,	1551,	NULL,	NULL,	NULL,	NULL,	'internship',	NULL,	NULL,	'<p>I have done 4 internships.Â </p><p>1) <strong>1-month internship </strong>- Digital marketing and photography - Droplet, Jaipur</p><p>2) <strong>2 months internship</strong>Â - Digital Marketing - Beatles Restaurant, Jaipur</p><p>3) <strong>2 months internship </strong>- B2C marketing- Flutura, Bangalore</p><p>4) <strong>45 days internship during lockdown</strong> - Marketing and management - Rising passion productions, Jaipur</p><p><br></p><p>Also, IÂ and my friendsÂ have started a new initiative in October mid related to mental health.Â </p><p>Name- <strong>TalkativeÂ </strong></p><p>Instagram id- BetalkativeeÂ  - we are opening our website and launching our own app very soon.Â </p><p>About-Â Â </p><p>we aim is to provide correct awareness among people about what actually mental health issues are and how we can support them and help them go through this. With the help of the experts, we have created reliable methods for eg; Socio groups, therapies, treatments, and also *Phone a friend* ( where you can talk to one of the group representatives about any of your issues)Â </p><p><br></p><p>Â we are providing people a platform to express themselves freely in an unbiased, non-judgmental, and friendly environment so that They can get a friend who will listen to them and help them to understand, accept and improve themselves.</p><p><br></p><p>Also, In December, I am planning to have a bake sale online around Christmas to the new year,Â  as I love cooking, I will sell not only bakery items but other food items or other continental dishes also, and whatever money I will get from the bake sale,Â  I will donate it some good Ngo for student education or for the old age people along with my food items.Â </p>',	'2022-04-14 07:26:01',	'2022-04-14 07:26:01'),
