</p><ul><li><ul><li>Researched and analyzed different global teams and leagues </li><li>Comparing the foreign/ Indian leagues and teams and then suggested the changes. </li><li>Made presentation on the researched teams. </li></ul></li></ul><p><br></p><p>8. Campus ambassador at Internshala for 3 months in Mumbai </p><ul><li><ul><li>Created social media awareness about the brand. </li><li>Made the students aware about different offers from the organization. </li><li>Promoted Internshala as a brand in the college campus.</li></ul></li></ul><p><br></p><p>9. Marketing and Business Development internship at Souled Store for 2 months in Mumbai </p><ul><li>Promoted Souled Store on social networking sites. </li><li>Generated sales. </li><li>Coordinating with colleges/ organization for merchandise partner.</li></ul>',	'2022-04-14 07:26:01',	'2022-04-14 07:26:01'),
